import React from 'react';
import { Box } from "@chakra-ui/react";
import { AdminPrivateRoute } from "../../components/AdminPrivateRoute/AdminPrivateRoute";
import WayBill from "../../components/WayBill";
import AdminPanel from "../../components/AdminPanel/AdminPanel";
import CustomerInfo from "../../components/AdminPanel/CustomerInfo/CustomerInfo";
import SignIn from "../../components/AdminPanel/SignIn";

export default function AdminAccount({ match: { path } }) {
    return (
        <>
            {/* <Box className="root-container"> */}
                <AdminPrivateRoute exact path={`${path}/adminpanel/*`} component={AdminPanel} />
                <AdminPrivateRoute exact path={`${path}`} component={AdminPanel} />
                <AdminPrivateRoute path={`${path}/signin`} component={SignIn} />
                <AdminPrivateRoute path={`${path}/customerInfo/:id/:type`} component={CustomerInfo} />
            {/* </Box> */}
        </>
    );
};
